import React, { useState, useEffect } from 'react'
import axios from "axios";

function Dashbord() {

    const [state, setstate] = useState({dashbord:{}, hospitalData: []})

   useEffect(() => {
     axios.get('https://hpb.health.gov.lk/api/get-current-statistical')
         .then(response =>{
             setstate({
                 dashbord:response.data,
                 hospitalData:response.data.hospital_data
             })
         })
         console.log(state)
    }, [])

    return (
        <div>
            <h1></h1>
        </div>
    )
}

export default Dashbord
